function AClick(selector, onclick, timer) {

    if (!timer) timer = 200;

    if (!(('ontouchstart'in window) || (navigator.maxTouchPoints > 0) || (navigator.msMaxTouchPoints > 0))) {

        $(document).on('click', selector, onclick);

        return;

    }

    $(document).on("touchstart", selector, function(e) {

        var swipedir = 'click',
        startX,
        startY,
        distX,
        distY,
        threshold = 50, //required min distance traveled to be considered swipe

        restraint = 100, // maximum distance allowed at the same time in perpendicular direction

        allowedTime = timer, // maximum time allowed to travel that distance

        elapsedTime,
        startTime, beginTime = new Date().getTime();

        $(this).on("touchmove", function(e) {

            var touchobj = getE(e);

            swipedir = 'none';

            dist = 0;

            startX = touchobj.pageX;

            startY = touchobj.pageY;

            startTime = new Date().getTime();
            // record time when finger first makes contact with surface

            // e.preventDefault();

        });

        $(this).on("touchend", function(e) {

            var touchobj = getE(e);

            distX = touchobj.pageX - startX;
            // get horizontal dist traveled by finger while in contact with surface

            distY = touchobj.pageY - startY;
            // get vertical dist traveled by finger while in contact with surface

            elapsedTime = new Date().getTime() - startTime;
            // get time elapsed

            if (elapsedTime <= allowedTime) {
                // first condition for awipe met

                if (Math.abs(distX) >= threshold && Math.abs(distY) <= restraint) {
                    // 2nd condition for horizontal swipe met

                    swipedir = (distX < 0) ? 'left' : 'right';
                    // if dist traveled is negative, it indicates left swipe

                }
                else if (Math.abs(distY) >= threshold && Math.abs(distX) <= restraint) {
                    // 2nd condition for vertical swipe met

                    swipedir = (distY < 0) ? 'up' : 'down';
                    // if dist traveled is negative, it indicates up swipe

                }

            } else {

                if (this.stopClicked) {

                    var me = this;

                    setTimeout(function() {

                        me.stopClicked = false;

                    }, 300);

                } else {

                    if (new Date().getTime() - beginTime < allowedTime) {

                        onclick.call(this, e);

                    }

                }

            }

            $(this).off("touchmove touchend");

        });

    });

}

$.fn.AClick = function(f, timer) {

    return this.each(function(i, v) {

        AClick(this, f, timer);

    });

}
