function setupFirebase(options){
     var fb = new Firebase(options.url?options.url:"https://tu-ech-default-rtdb.firebaseio.com");
    
    var io = fb.child(options.room);

    function send(data){
        data = typeof data=="object"?data:{
                text : data
            };
      if(!data._id)data._id = Date.now(); 
       io.push(data); 
    }
    
    function create(r){
       return {
         io : fb.child(r),
         send : function(data){
            data = typeof data=="object"?data:{
                text : data
            };

             if(!data._id)data._id = Date.now(); 
            this.io.push(data); 
         }
       }
    }

    return {
        io:io,
        send : send,
        create:create
    };
}

