           function getJsonFromUrl(url) {
  var regex = /[?&]([^=#]+)=([^&#]*)/g,
      url = url?url:window.location.href,
      params = {},
      match;
  while(match = regex.exec(url)) {
      params[match[1]] = match[2];
  }
  return params;
} 
String.prototype.URLParams  = function(){  
    return getJsonFromUrl(String(this));
};


